import React, { useCallback, useState, useEffect } from "react";
import { useSelector } from "react-redux";
import { Link as RouterLink } from "react-router-dom";
import clsx from "clsx";
import moment from "moment";
import PerfectScrollbar from "react-perfect-scrollbar";
import PropTypes from "prop-types";
import {
	Box,
	Button,
	Card,
	CardHeader,
	Divider,
	Table,
	TableBody,
	TableCell,
	TableHead,
	TableRow,
	TableSortLabel,
	Tooltip,
	makeStyles,
} from "@material-ui/core";
import NavigateNextIcon from "@material-ui/icons/NavigateNext";
import Label from "src/components/Label";
import GenericMoreButton from "src/components/GenericMoreButton";
import axios from "src/utils/axios";
import useIsMountedRef from "src/hooks/useIsMountedRef";

const labelColors = {
	complete: "success",
	pending: "warning",
	rejected: "error",
};

const useStyles = makeStyles((theme) => ({
	root: {},
	navigateNextIcon: {
		marginLeft: theme.spacing(1),
	},
}));

function LatestOrders({ className, ...rest }) {
	const classes = useStyles();
	const documents = useSelector((state) => state.documents.documents);
	const isMountedRef = useIsMountedRef();
	const [orders, setOrders] = useState(null);

	const getOrders = useCallback(() => {
		axios.get("/api/reports/latest-orders").then((response) => {
			if (isMountedRef.current) {
				setOrders(response.data.orders);
			}
		});
	}, [isMountedRef]);

	useEffect(() => {
		getOrders();
	}, [getOrders]);

	if (!orders) {
		return null;
	}
	console.log(documents);

	return (
		<Card className={clsx(classes.root, className)} {...rest}>
			<CardHeader action={<GenericMoreButton />} title="My Documents" />
			<Divider />
			<PerfectScrollbar>
				<Box minWidth={700}>
					<Table>
						<TableHead>
							<TableRow>
								<TableCell sortDirection="desc">
									<Tooltip enterDelay={300} title="Sort">
										<TableSortLabel active direction="desc">
											Order ID
										</TableSortLabel>
									</Tooltip>
								</TableCell>
								<TableCell>Customer</TableCell>
								<TableCell>Items</TableCell>
								<TableCell>Total</TableCell>
								<TableCell>Status</TableCell>
								<TableCell align="right">Date</TableCell>
							</TableRow>
						</TableHead>
						<TableBody>
							{orders.map((order) => (
								<TableRow hover key={order.id}>
									<TableCell>{order.ref}</TableCell>
									<TableCell>{order.customer.name}</TableCell>
									<TableCell>{order.items}</TableCell>
									<TableCell>
										{order.currency}
										{order.value}
									</TableCell>
									<TableCell>
										<Label color={labelColors[order.status]}>{order.status}</Label>
									</TableCell>
									<TableCell align="right">{moment(order.createdAt).format("DD MMM, YYYY hh:mm:ss")}</TableCell>
								</TableRow>
							))}
						</TableBody>
					</Table>
				</Box>
			</PerfectScrollbar>
			<Box p={2} display="flex" justifyContent="flex-end">
				<Button component={RouterLink} size="small" to="/app/management/orders">
					See all
					<NavigateNextIcon className={classes.navigateNextIcon} />
				</Button>
			</Box>
		</Card>
	);
}

LatestOrders.propTypes = {
	className: PropTypes.string,
};

export default LatestOrders;
